            <div className="side-bar"> Le menu de gauche </div>
            <div className="section">
                affichage des informations
            </div>
            <div className="footer">Copy Right | tous droit réservé . Page écris par le dévéloppeur kratos bosse</div>
        </div>

    )
}

export default Dashboard;
